import React from 'react';
import './Logo.css';

const Logo = () => {
  // 你可以在这里更改 logo 图片的路径
  // 只需要将图片放在 public/images/ 目录下，然后修改 logoImagePath
  const logoImagePath = '/images/logo.png'; // 修改这里的文件名
  const useImageLogo = false; // 设置为 true 使用图片，false 使用 SVG

  return (
    <div className="logo">
      {useImageLogo ? (
        // 使用本地图片
        <img 
          src={logoImagePath} 
          alt="TechFocus Logo" 
          className="logo-image"
          onError={(e) => {
            console.warn('Logo 图片加载失败，请检查图片路径:', logoImagePath);
            // 如果图片加载失败，可以显示备用文本
            e.target.style.display = 'none';
            e.target.nextSibling.style.display = 'block';
          }}
        />
      ) : (
        // 使用 SVG (当前默认)
        <svg width="120" height="65" viewBox="0 0 306 65" fill="none" xmlns="http://www.w3.org/2000/svg">
          <path d="M8.59 2.18H60.79V63.42H8.59V2.18Z" fill="#0A3161"/>
          <path d="M38.75 5.37H45.66V14.52H38.75V5.37Z" fill="#3885B8"/>
          <path d="M40.53 34.78H43.86V38.13H40.53V34.78Z" fill="#F4F7FA"/>
          <path d="M75.36 23.18H98.18V49.46H75.36V23.18Z" fill="#0A3161"/>
          <path d="M147.77 23.17H172.93V49.45H147.77V23.17Z" fill="#0A3161"/>
          <path d="M174.55 23.18H197.24V49.48H174.55V23.18Z" fill="#0A3161"/>
          <path d="M101.47 30.42H122.15V49.88H101.47V30.42Z" fill="#0A3161"/>
          <path d="M199.78 30.31H222.04V50H199.78V30.31Z" fill="#0A3161"/>
          <path d="M125.24 30.68H145.67V50.02H125.24V30.68Z" fill="#0A3161"/>
          <path d="M225.12 30.68H245.55V50.02H225.12V30.68Z" fill="#0A3161"/>
          <path d="M275.35 30.68H293.27V49.94H275.35V30.68Z" fill="#0A3161"/>
          <path d="M247.89 30.91H272.8V49.89H247.89V30.91Z" fill="#0A3161"/>
          <path d="M25.13 42.39H57.89V52.76H25.13V42.39Z" fill="#FBFCFD"/>
          <path d="M33.32 43.6H54.68V44.07H33.32V43.6Z" fill="#B6CEE5" fillOpacity="0.9"/>
        </svg>
      )}

      {/* 备用文本 logo (当图片加载失败时显示) */}
      <div className="logo-fallback" style={{display: 'none'}}>
        TechFocus
      </div>

      <span className="logo-text">TechFocus</span>
    </div>
  );
};

export default Logo;
